'use strict';
class StdlibStringMap {
    data
    length() {
        return this.data.size;
    }
    contains(key) {
        return this.data.has(key);
    }
    get(key) {
        if(!this.data.has(key))
            throw new Error("Map not contain key: " + key);
        return this.data.get(key);
    }
    set(key, value) {
        this.data.set(key, value);
    }
    remove(key) {
        this.data.delete(key);
    }
    keys() {
        return Array.from(this.data.keys());
    }
    clear() {
        this.data.clear();
    }
    constructor() {
        this.data = new Map();
    }
}

let string_map = StdlibStringMap;
module.exports = string_map;